fnGetTrend <-function(dInputarray1, dInputArray2, dPercentConfidenceInterval = 95, intWhat = 0) {
# Purpose: To calculate Spearman's Rho, p at which rho = 0 
# and if intWhat = 0 TRUE/FALSE
# confidence limits for given Percent Confidence Interval (dPercentConfidenceInterval)
#
# History: Created February 2010 in VBA by Gregory E. Granato ggranato@usgs.gov
#
# Arguments:
# dInputarray1 First of 2 paired arrays must have same number of values & no NA's   
# dInputarray2 Second of 2 paired arrays must have same number of values & no NA's
# dPercentConfidenceInterval: The percent confidence interval (0 < dPercentConfidenceInterval < 100)
# intWhat Flag determining return value(s)
# intWhat = 0 return boolean TRUE/FALSE True: there is a trend FALSE: No trend
# intWhat = 1 return only rho
# intWhat = 2 return rho & P
# intWhat = 3 return rho & P & TRUE/FALSE
# intWhat = 4 return rho & P & confidence intervals (if cross zero no trend at dPercentConfidenceInterval)
# intwhat = 5 return rho & P & confidence intervals  & TRUE/FALSE
# intWhat = 6 return rho & P & VB/VBA integer for TRUE/FALSE
# intWhat = 7 return rho & P & confidence intervals  &  VB/VBA integer for TRUE/FALSE 
# intWhat = 8 rho & P & confidence intervals  &  VB/VBA integer for TRUE/FALSE
# intWhat = 9 intwhat = 9 return VB/VBA integer integer for TRUE/FALSE
# *** Note: vb.net treats False as zero and True as a non-zero integer.
#  If a boolean is required it may be best to take a number and do an if then to 
#  covert to a boolean in .net  
  
# Uses ggranato@usgs.gov fnGetFishersZ and built-in R cor() function

 # Skip look for problems

 # Get Rho
  dMyRho <- cor(dInputarray1, dInputArray2, method = "spearman") 

 # Get the upper and lower confidence interval and p zero  
 # Use fnGetFishersZ to get dMyValues(p, and the upper and lower confidence intervals) 
 # and report if needed 
  dMyValues <- fnGetFishersZ(dMyRho, length(dInputarray1), dPercentConfidenceInterval, 3)
  dMyP <- dMyValues[1]
  dMyLowerCI <- dMyValues[2]
  dMyUpperCI <- dMyValues[3]
  
  # calculate the p to test to determine trend
  dConfidenceIntervalP <- (1-(dPercentConfidenceInterval/100))
  # test calculated P against confidence interval p threshold
  if (dMyP > dConfidenceIntervalP) {
   booleanIsTrend = FALSE
  } else {
    booleanIsTrend = TRUE 
  }  
  # Provide output
  # If intWhat = 0 return boolean TRUE/FALSE True: there is a trend FALSE: No trend
  # note except for intWhat == 0 booleanIsTrend is converted to number zero being false and all non-zero values being true
  OutputArray <- booleanIsTrend # This is the else condition (intWhat = 0 or > 9)
  # intWhat = 1 return only rho
  if (intWhat == 1) {OutputArray <- dMyRho} 
  # intWhat = 2 return rho & P
  if (intWhat == 2) {OutputArray <- c(dMyRho, dMyP)} 
  # intWhat = 3 return rho & P & TRUE/FALSE
  if (intWhat == 3) {OutputArray <- c(dMyRho, dMyP, booleanIsTrend)}
  # intWhat = 4 return rho & P & confidence intervals (if cross zero no trend at dPercentConfidenceInterval)
  if (intWhat == 4) {OutputArray <- c(dMyRho, dMyP, dMyLowerCI, dMyUpperCI)}
  # intwhat = 5 return rho & P & confidence intervals  & TRUE/FALSE
  if (intWhat == 5) {OutputArray <- c(dMyRho, dMyP, dMyLowerCI, dMyUpperCI, booleanIsTrend)}
  # intWhat = 6 return rho & P & VB/VBA integer integer for TRUE/FALSE
  if (intWhat == 6) {OutputArray <- c(dMyRho, dMyP, booleanIsTrend * -1)}
  # intwhat = 7 return rho & P & confidence intervals  &  VB/VBA integer integer for TRUE/FALSE
  if (intWhat == 7) {OutputArray <- c(dMyRho, dMyP, booleanIsTrend * -1)}
  # intwhat = 8 return rho & P & confidence intervals  &  VB/VBA integer integer for TRUE/FALSE
  if (intWhat == 8) {OutputArray <- c(dMyRho, dMyP, dMyLowerCI, dMyUpperCI, booleanIsTrend * -1)}
  # intwhat = 9 return VB/VBA integer integer for TRUE/FALSE
  if (intWhat == 9) {OutputArray <- c(booleanIsTrend * -1)}
 
  return(OutputArray)
  
# End Function   
}

